import React from "react";
import { Container, Row, Col } from "react-bootstrap";
import useMyList from "./f"; // Corrected import statement
import Product from "./mylistscreen";
import Footer from "./Footer";

function MyList() {
    const myListDetails = useMyList(); // Changed variable name to match the function name

    const getMovieImageURL = (movieId) => {
      const movie = myListDetails.find((movie) => movie.id === parseInt(movieId));
      return movie ? movie.image_url : null;
    };

    const getMovieTitle = (movieId) => {
      const movie = myListDetails.find((movie) => movie.id === parseInt(movieId));
      return movie ? movie.title : null;
    };


    const movieImageURL = getMovieImageURL(3);
    const currentMovieTitle = getMovieTitle(3);

    return (
        <>
            <Container>
                <br />
                <h1>My List</h1> {/* Changed heading */}
                <Row>
                    {myListDetails.map((item) => ( // Changed variable name to match the map function
                        <Col key={item.id} sm={12} md={6} lg={4} xl={3}> {/* Changed key and variable name */}
                            <Product product={item} /> {/* Changed variable name */}
                        </Col>
                    ))}
                </Row>
            </Container>
            <Footer />
        </>
    );
}

export default MyList;
